import React, { useState } from "react";
import DataFetcher from "./dataFetcher";
import TableHeader from "./tableHeader";
import TableRow from "./tableRow";

const Table = ({ apiUrl, itemName, itemKeys, customColumns }) => {
    const [data, setData] = useState([]);

    const handleDataFetched = (fetchedData) => {
        setData(fetchedData);
    };

    return (
        <div style={{ color: "white" }}>
            <h2>{`${itemName}`}</h2>
            <table>
                <TableHeader customColumns={customColumns} />
                <tbody>
                    {data.map((item, index) => (
                        <TableRow
                            key={index}
                            item={item}
                            columns={itemKeys}
                            apiUrl={apiUrl}
                            onDataUpdate={handleDataFetched}
                        />
                    ))}
                </tbody>
            </table>
            <DataFetcher apiUrl={apiUrl} onDataUpdate={handleDataFetched} />
        </div>
    );
};

export default Table;
